    "summary": "\u003cbr\u003e\u003ca href=\"http://twitter.com/elliemariemfc\" target=\"_blank\"\u003e\u003cimg src=\"http://i66.tinypic.com/21drk9j.png\"\u003e\u003c/a\u003e\u003ca href=\"http://instagram.com/elliemariemfc\" target=\"_blank\"\u003e\u003cimg src=\"http://i64.tinypic.com/dggoko.jpg\"\u003e\u003c/a\u003e\u003cbr\u003ehiyo!~\u00a0\u003cbr\u003ei\u0027m Ellie! a cosplayer and camgirl from canada~\u003cbr\u003e\u003cbr\u003ewanna buy me a gift?\u00a0\u003ca href=\"http://a.co/8J6jOIg\" target=\"_blank\"\u003e\u003cspan style=\"color: rgb(178, 162, 199);\"\u003e\u003cstrong\u003eclick here for my wishlist!\u003c/strong\u003e\u003c/span\u003e\u003c/a\u003e\u003cbr\u003e\u003cbr\u003e\u003cspan style=\"color: rgb(75, 172, 198);\"\u003e\u003cstrong\u003ePatreon? Why Should i pledge?\u003c/strong\u003e\u003c/span\u003e\u003cbr\u003epatreon helps me continue to do what i love which is cosplaying~\u00a0\u003cbr\u003esupporting me on patreon means i can continue to bring out new cosplays, try new things, create exclusive sets and just continue doing what i love and sharing that with you guys!\u003cbr\u003ejoining means that you will be able to access exclusive content to patreon, i will post a few previews on social media but patrons will get full access!\u003cbr\u003e\u003cbr\u003e\u003cspan style=\"color: rgb(178, 162, 199);\"\u003e\u003cstrong\u003eWhat to Expect~\u003c/strong\u003e\u003c/span\u003e\u003cbr\u003e\u003cul\u003e\u003cli\u003eaccess to exclusive content and photosets!\u003c/li\u003e\u003cli\u003ewip of future cosplays\u003c/li\u003e\u003cli\u003eexclusive physical rewards depending on the tier!{Prints\u0026amp;Polaroids}\u003c/li\u003e\u003cli\u003esnapchat access\u003c/li\u003e\u003cli\u003eexclusive lewd/boudoir photos!\u003c/li\u003e\u003cli\u003ei post photos regularly\u003c/li\u003e\u003cli\u003efull cosplay photosets{usually around 10-20 photos per}\u003c/li\u003e\u003cli\u003ediscord chat, so we can chat more!\u003c/li\u003e\u003cli\u003efansigns!~\u003c/li\u003e\u003cli\u003elots of luuuuv!\u003c/li\u003e\u003c/ul\u003e\u003cdiv style=\"text-align: center;\"\u003e\u003c/div\u003e\u003cimg src=\"https://photos-3.dropbox.com/t/2/AAAe5_EtYjSDFoDxyU4qu__QEjGCPs7SnFHXZgvx5pyEmQ/12/378218642/jpeg/32x32/1/_/1/2/sfw%20cosplay%20sets.jpg/EPzUzIADGJFZIAcoBw/salCv-vqDoKhAKPwf7ZlJyMlzxoomz2B0-KoogzKdqY?size=2048x1536\u0026amp;size_mode=3\"\u003e\u003cbr\u003e\u003cspan style=\"color: rgb(155, 187, 89);\"\u003e\u003cstrong\u003eHow do rewards work?~\u003cbr\u003e\u003c/strong\u003e\u003c/span\u003eyou get rewards for the month you pledge too!\u003cbr\u003eso if you pledge in the month of august, you get the rewards for that month.\u003cbr\u003ehow i distribute the rewards, \u003cem\u003eif you pledge in august you will receive your rewards throughout the following month{so september in this case}\u003c/em\u003e\u003cbr\u003ealso physical rewards will be sent out at the end of the month after all the digital rewards have been released!\u003cbr\u003e\u003cstrong\u003ejust to be safe for me that people don\u0027t back out within the month and get free rewards.\u003cbr\u003e\u003c/strong\u003e\u003cdiv style=\"text-align: center;\"\u003e\u003cspan style=\"color: rgb(0, 0, 0);\"\u003e\u003cem\u003e\u003cspan style=\"color: rgb(0, 0, 0);\"\u003e\u003cstrong\u003eAlso available are sfw cosplay photosets by joining the 15$ tier!\u003c/strong\u003e\u003c/span\u003e\u003c/em\u003e\u003cbr\u003e\u003cstrong\u003e\u003c/strong\u003e\u003cbr\u003e\u003cstrong\u003e\u003cspan style=\"color: rgb(128, 100, 162);\"\u003e\u003c/span\u003e\u003c/strong\u003e\u003c/span\u003e\u003cstrong\u003e\u003cspan style=\"color: rgb(128, 100, 162);\"\u003eif you\u0027ve missed out on pass rewards, join the\u00a0 100-200$ tier for access+more!\u003cbr\u003e\u003cbr\u003e\u003cspan style=\"color: rgb(75, 172, 198);\"\u003e*below are the past photosets!*\u003c/span\u003e\u003cbr\u003e\u003c/span\u003e\u003c/strong\u003e\u003cimg src=\"https://photos-4.dropbox.com/t/2/AADhOVDl4um3gH9HgbeWWJ_x_xzv8a1JJQd8cUXNv8KVjg/12/378218642/jpeg/32x32/1/_/1/2/past%20photosets.jpg/EPzUzIADGMlaIAcoBw/UAIBO7jxUSOGlhgEOJLND57fAI9YPZu4qPfFFiyuYQY?size=2048x1536\u0026amp;size_mode=3\"\u003e\u003cbr\u003e\u003c/div\u003e\u003cspan style=\"color: rgb(217, 150, 148);\"\u003e\u003cstrong\u003eDisclaimer\u003c/strong\u003e\u003c/span\u003e\u003cbr\u003eto ensure nobody backs out i will only send out rewards of that month once payment has cleared!\u003cbr\u003ei want to do my best to cater to you supporters, so i will be doing monthly polls on what you\u0027d like to see.\u00a0\u003cbr\u003ethe higher tiers will have accessibility to more saucier/nsfw content so if that\u0027s what you fancy join one of those to get in on it!\u003cbr\u003e\u003cbr\u003ei appreciate everyone that continuously supports me whether it be on patreon or other platforms, you guys are what keeps me going. \u00a0\u003cbr\u003ethankyou so much\u00a0\u003cbr\u003e"
